import React, { useState, useEffect } from 'react';
import { useParams, useNavigate, Link } from 'react-router-dom';
import api from '../../services/api';

export default function EditarDono() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '', telefone: '', email: '', cpf: '', endereco: '',
    dataNascimento: '', responsavel: false, ativo: true, observacoes: ''
  });

  useEffect(() => {
    api.get(`/donos/${id}`).then(res => setForm(res.data));
  }, [id]);

  const handleChange = e => {
    const { name, value, type, checked } = e.target;
    setForm(f => ({ ...f, [name]: type === 'checkbox' ? checked : value }));
  };

  const handleSubmit = async e => {
    e.preventDefault();
    await api.put(`/donos/${id}`, form);
    navigate('/donos');
  };

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Editar Dono</h2>
        <div>
          <Link to="/" className="btn btn-outline-secondary me-2">Voltar ao Início</Link>
          <Link to="/donos" className="btn btn-secondary">Ver Donos</Link>
        </div>
      </div>

      <form onSubmit={handleSubmit}>
        <div className="mb-3"><label className="form-label">Nome</label>
          <input name="nome" className="form-control" value={form.nome} onChange={handleChange} />
        </div>
        <div className="mb-3"><label className="form-label">Telefone</label>
          <input name="telefone" className="form-control" value={form.telefone} onChange={handleChange} />
        </div>
        <div className="mb-3"><label className="form-label">Email</label>
          <input name="email" type="email" className="form-control" value={form.email} onChange={handleChange} />
        </div>
        <div className="mb-3"><label className="form-label">CPF</label>
          <input name="cpf" className="form-control" value={form.cpf} onChange={handleChange} />
        </div>
        <div className="mb-3"><label className="form-label">Endereço</label>
          <input name="endereco" className="form-control" value={form.endereco} onChange={handleChange} />
        </div>
        <div className="mb-3"><label className="form-label">Data de Nascimento</label>
          <input type="date" name="dataNascimento" className="form-control" value={form.dataNascimento} onChange={handleChange} />
        </div>
        <div className="form-check mb-3">
          <input type="checkbox" className="form-check-input" name="responsavel" checked={form.responsavel} onChange={handleChange} />
          <label className="form-check-label">Responsável</label>
        </div>
        <div className="form-check mb-3">
          <input type="checkbox" className="form-check-input" name="ativo" checked={form.ativo} onChange={handleChange} />
          <label className="form-check-label">Ativo</label>
        </div>
        <div className="mb-3"><label className="form-label">Observações</label>
          <textarea name="observacoes" className="form-control" rows="3" value={form.observacoes} onChange={handleChange} />
        </div>
        <button type="submit" className="btn btn-primary">Salvar</button>
      </form>
    </div>
  );
}
